import React from "react";
import { Col, Container, Nav, Row, Tab, TabPane } from "react-bootstrap";
import ProjectCard from "./ProjectCard";
import prep27 from "../assets/img/prep27.png";
import colorSharp2 from "../assets/img/color-sharp2.png";
import project from "../assets/img/project-img1.png";
const Project = () => {
  const projects = [
    {
      titel: "Prep 27",
      descripation: "Design and development",
      ImgUrl: prep27,
    },
    {
      titel: "Prep 27",
      descripation: "Design and development",
      ImgUrl: project,
    },
    { titel: "Prep 27", descripation: "Design and development", ImgUrl: "..." },
  ];
  return (
    <section className="project">
      <Container>
        <Row>
          <Col>
            <h2>Projects</h2>
            <p>Prathamesh</p>
            <Tab.Container id="project-taps" defaultActiveKey="link-1">
              <Nav variant="pills" defaultActiveKey="/home">
                <Nav.Item>
                  <Nav.Link eventKey="link-1">Company Project</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link eventKey="link-2">My Project</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link eventKey="link-3">Disabled</Nav.Link>
                </Nav.Item>
              </Nav>
              <Tab.Content>
                <Tab.Pane eventKey="link-1">
                  {projects.map((items, index) => {
                    return (
                      <ProjectCard
                        key={index}
                        titel={items.titel}
                        descripation={items.descripation}
                        imgeUrl={items.ImgUrl}
                      />
                    );
                  })}
                </Tab.Pane>
                <Tab.Pane eventKey="link-2">link-2</Tab.Pane>
                <Tab.Pane eventKey="link-3">link-3</Tab.Pane>
                {/* <Tap.TabPane eventKey="link-1">kkk</Tap.TabPane> */}
              </Tab.Content>
            </Tab.Container>
          </Col>
        </Row>
      </Container>
      <img src={colorSharp2} alt="..." className="background-image-right" />
    </section>
  );
};

export default Project;
